measurements.description:
Three flowers on one unstaked 33.5-cm inflorescence,
 five buds on two juvenile inflorescences;
 sepals and petals oblanceolate, chartreuse overlaid and 
 veined burgundy, petals slightly porrect;
 lip recurved, undulated edges, light yellow, deep burgundy apical one third,
 white picotee, keel bright yellow;
 column cream, sporadic burgundy markings, inferior surface striped burgundy,
 anther cap white; substance firm; texture matte.
